import React from "react";
import "./QueenCard.css";

const QueenCard = (queen) => {
    return (
        <div
        className="queenCard"
        key="{queen.key}">
            <img src={queen.imageSrc} alt=""/>
            <h3>{queen.name}</h3>
            <button onClick={() => this.props.displayFeature(queen.key)}>Click to learn more!</button>
        </div>
    )
}

export default QueenCard;
